import { createApp } from 'vue'
import App from './App.vue'
import router from "@/router/router";
import 'element-plus/dist/index.css';

createApp(App).use(router).mount('#app', {
    compilerOptions: {
        isCustomElement: tag => tag.startsWith('el-')
    }
});
